import { Link } from 'react-router-dom';

function Edu(props){
    <div className="edu">
        <h1>Education
            <p1>{props.university}</p1>
            <p1>{props.graduationby}</p1>
            <p1>{props.course}</p1>
        </h1>
    </div>
};

export default Edu;
